import "../styles/JobResults.css";

const JobResults = () => (
    <div className="results-table">
        <h3 className="results">Results</h3>
        <div class="card">
            <img src="img_avatar.png" alt="Avatar" style="width:100%"></img>
                <div class="container">
                    <h4><b>John Doe</b></h4>
                    <p>Architect Engineer</p>
                </div>
        </div>
    </div>

        );


export default JobResults
